        {% endblock %}
        <script src=\"https:s//ajax.googleapis.com/ajax/libs/jquery/3.3.1/jquery.min.js\"></script>
    </head>
    <header>
        <nav class=\"navbar navbar-expand-lg navbar-dark bg-primary\">
            <a class=\"navbar-brand\" href=\"#\">Navbar</a>
            <button class=\"navbar-toggler\" type=\"button\" data-toggle=\"collapse\" data-target=\"#navbarColor01\" aria-controls=\"navbarColor01\" aria-expanded=\"false\" aria-label=\"Toggle navigation\">
                <span class=\"navbar-toggler-icon\"></span>
            </button>

            <div class=\"collapse navbar-collapse\" id=\"navbarColor01\">
                <ul class=\"navbar-nav mr-auto\">
                    <li class=\"nav-item active\">
                        <a class=\"nav-link\" href=\"/index\">Blog</a>
                    </li>
                    {% if app.user %}
                        <li class=\"nav-item active\">
                            <a class=\"nav-link\" href=\"/account\">Mon profil</a>
                        </li>
                        <li class=\"nav-item active\">
                            {% if app.user.amount < 1 %}
                                <a class=\"nav-link alert-danger\" href=\"#\">Jouer ({{ app.user.amount }}\$)</a>
                            {% else %}
                                <a class=\"nav-link\" href=\"{{ path('game_play') }}\">Jouer ({{ app.user.amount }}\$)</a>
                            {% endif %}
                        </li>
                        <li class=\"nav-item active\">
                            <a class=\"nav-link\" href=\"/logout\">Déconnexion</a>
                        </li>
                    {% else %}
                        <li class=\"nav-item active\">
                            <a class=\"nav-link\" href=\"/login\">Connexion</a>
                          </li>
                        <li cl  ass=\"nav-item active\">
                            <a class=\"nav-link\" href=\"/register\">Inscription</a>
                        </li>
                    {% endif %}
                    {% if is_granted('ROLE_ADMIN') %}
                        <li class=\"nav-item active\">
                            <a class=\"nav-link btn btn-success\" href=\"/admin\">Admin</a>
                        </li>
                        <li class=\"nav-item active\">
                            <a class=\"nav-link btn btn-warning\" href=\"{{ path('game_run') }}\">START NEXT ROUND</a>
                        </li>
                    {% endif %}
                </ul>
            </div>
